import logo from './logo.svg';
import './App.css';
import NavBar from './NavBar.js'
import Carousel from './carousel.js'
import Card from './Card'
import SignUp from './Signup.js'
import  Login from './Login.js'

var obj={
  image:"flag.png",
  name:"America"
}

var obj2={
  image:"india.png",
  name:"India"
}

function App() {
  return (
    <div className="App">

      <Login/>
      <SignUp></SignUp>
     <NavBar/>
     <Carousel></Carousel>

     <Card countrydata={obj}></Card>
     <Card countrydata={obj2}></Card>


    </div>
  );
}

export default App;
